import React from 'react';
import './App.css'

function App(){
  const [count,setCount]=React.useState(0);
  return(
    <div className='prnt'>
      <button onClick={()=>setCount(count+1)} id='add'>+</button>
      <h1>{count}</h1>
      <button onClick={()=>setCount(count+1)} id='moi'>-</button>
    </div>
  )
}
export default App
